<script>
import {
  AppConfig,
  UserSession,
  showConnect,
  openSTXTransfer,
  openContractCall,
} from "@stacks/connect";
import { makeContractCall, broadcastTransaction } from "@stacks/transactions";
import { ref, onMounted } from "vue";

import { StacksTestnet, StacksMocknet } from "@stacks/network";
import {
  uintCV,
  intCV,
  bufferCV,
  stringAsciiCV,
  stringUtf8CV,
  standardPrincipalCV,
  trueCV, 
} from "@stacks/transactions";

export default {
  name: "App",
  setup() {
    const appConfig = new AppConfig(
      ["store_write", "publish_data"],
      "http://localhost:3999"
    );
    const depositAmount = ref();
    const repay = ref();
    const userSession = new UserSession({ appConfig });
    const authOptions = {
      appDetails: {
        name: "Hello Stacks",
        icon: "http://localhost:3000/favicon.ico",
      },
      redirectTo: "/",
      manifestPath: "/manifest.json",
      onFinish: (param) => {
        console.log("finished login", { param });
        userData.value = userSession.loadUserData();
      },
      onCancel: (param) => {
        console.log("cancelled login", { param });
      },
    };
    const connectWallet = () => {
      showConnect(authOptions);
    };
    const userTransactionRef = ref(null);
    const testDeposit = async () => {
      await openContractCall({
        contractAddress: "ST1PQHQKV0RJXZFY1DGX8MNSNYVE3VGZJSRTPGZGM",
        contractName: "lagoon",
        functionName: "deposit",
        functionArgs: [uintCV(Number(depositAmount.value))],
        onFinish: (data) => {
          console.log(
            `https://explorer.hiro.so/txid/${data.txId}?chain=testnet&api=http://localhost:${3999}`
          );
          userTransactionRef.value = `https://explorer.hiro.so/txid/${data.txId}?chain=testnet&api=http://localhost:${3999}`;
        },
        onCancel: () => {
          console.log("cancel");
        },
        network: new StacksMocknet(),
      });
    };

    const userData = ref(null);

    onMounted(() => {
      if (userSession.isSignInPending()) {
        userSession.handlePendingSignIn().then((data) => {
          userData.value = data;
          console.log(userData);
          delete userData.value.authResponseToken;
          delete userData.value.gaiaAssociationToken;
        });
      } else if (userSession.isUserSignedIn()) {
        userData.value = userSession.loadUserData();
        delete userData.value.authResponseToken;
        delete userData.value.gaiaAssociationToken;
      }
    });
    return {
      depositAmount,
      testDeposit,
      connectWallet,
      userTransactionRef,
      userData,
      repay,
      elevationData: [],
    };
  },
};
</script>

<template>
  <div class="h-screen">
    <nav
      class="flex items-center justify-between bg-white p-4 w-screen shadow-2xl mb-6"
    >
      <svg
        width="139"
        height="132"
        viewBox="0 0 139 132"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        xmlns:xlink="http://www.w3.org/1999/xlink"
      >
        <rect width="139" height="131.97" fill="url(#pattern0_1022_51)" />
        <defs>
          <pattern
            id="pattern0_1022_51"
            patternContentUnits="objectBoundingBox"
            width="1"
            height="1"
          >
            <use
              xlink:href="#image0_1022_51"
              transform="matrix(0.00126263 0 0 0.00132988 0 -0.0186548)"
            />
          </pattern>
          <image
            id="image0_1022_51"
            width="792"
            height="780"
            xlink:href="data:image/png;base64,"
          />
        </defs>
      </svg>

      <button
        class="bg-[#422397] text-gray-800 rounded-lg py-2 px-4 text-white"
        @click="connectWallet"
      >
        {{
          `${userData?.profile?.stxAddress?.testnet.substring(0, 12)}...` ||
          "Connect Wallet"
        }}
      </button>
    </nav>
    <form
      @submit.prevent="testDeposit"
      class="max-w-md mx-auto flex-col flex justify-between gap-2 mt-2"
    >
      <label for="deposit">Deposit:</label>
      <input
        type="number"
        v-model="depositAmount"
        placeholder="Deposit Amount"
        id="depositAmount"
        class="border-[#E2E2E2] rounded-xl p-2 border-2 text-sm h-12 font-light"
      />
      <button
        type="submit"
        class="bg-gray-200 text-gray-800 rounded-lg py-2 px-4"
      >
        Submit
      </button>
    </form>

    <form
      @submit.prevent="testDeposit2"
      class="max-w-md mx-auto flex-col flex justify-between gap-2 mt-2"
    >
      <label for="repay">Repay loan amount</label>
      <input
        type="number"
        v-model="repay"
        placeholder="Repay loan amount"
        id="repay"
        class="border-[#E2E2E2] rounded-xl p-2 border-2 text-sm h-12 font-light"
      />
      <button
        type="submit"
        class="bg-gray-200 text-gray-800 rounded-lg py-2 px-4"
      >
        Submit
      </button>
    </form>
    <h2>Claim Yield</h2>
    <button class="bg-gray-200 text-gray-800 rounded-lg py-2 px-4">
      Claim
    </button>
    <div v-if="userData" class="w-[60%]">
      {{ userData.profile.stxAddress.testnet }}
    </div>
  </div>
</template>
